import { Link } from "react-router-dom";

export const ProductsPage = () => {
  const PRODUCTS = [
    { id: "p1", title: "Product1" },
    { id: "p2", title: "Product2" },
    { id: "p3", title: "Product3" },
  ];
  return (
    <>
      <h1>My products</h1>
      <ul>
        {PRODUCTS.map((product) => (
          <li key={product.id}>
            <Link to={`/products/${product.id}`}>{product.title}</Link>
          </li>
        ))}
      </ul>
    </>
  );
};
